/** *	HtmlLoad navigator * *	@param cntr selector *	@param url URL ***/ServiceClient.jquery.navigator.HtmlLoad = function(config){	return [{		service : ServiceClient.jquery.view.ElementView,		elementid : config.cntr	},{		service : ServiceClient.jquery.loader.AjaxLoader,		loadurl : config.url,		datatype : 'html',		workflow : [{			service : ServiceClient.jquery.renderer.ContentUI		}]	}];}